import React from "react";
import {FaPaperclip, FaPaperPlane, FaSmile} from "react-icons/fa";

class Entry extends React.Component{
    constructor(props){
        super(props)
        this.state = {
            text:"",
            msg: {
                id: 0,
                received: false,
                text:"",
                time:""
            }
        }
    }
    
    render(){
        return (
            <form className="flex-row-nowrap">
                <FaPaperclip className="icon"/>
                <textarea className="tinput" onChange={(event) => this.setState({text: event.target.value})} type="text" rows="1" placeholder="Write a message"/>
                <FaSmile className="icon"/>
                <FaPaperPlane className="icon"/>
            </form>
        )
    }
}

export default Entry
